要统计给定文本中每个字符的出现次数，可以按照以下步骤进行：

### 1. **将文本转换为字符数组**
首先，将输入的文本字符串转换为字符数组，以便逐个处理每个字符。

```csharp
char[] charArray = text.ToCharArray();
```

### 2. **使用LINQ进行分组和统计**
利用LINQ（Language Integrated Query）对字符数组进行分组，并统计每个字符的出现次数。然后按出现次数降序排序，若次数相同则按字符升序排序。

```csharp
var charFrequency = charArray
    .GroupBy(c => c)
    .Select(g => new { Character = g.Key, Count = g.Count() })
    .OrderByDescending(g => g.Count)
    .ThenBy(g => g.Character);
```

### 3. **输出统计结果**
遍历统计结果，并格式化输出每个字符及其出现次数。

```csharp
Console.WriteLine("字符频率统计:");
foreach (var item in charFrequency)
{
    Console.WriteLine($"字符 '{item.Character}' 出现了 {item.Count} 次");
}
```

### 完整代码示例
```csharp
using System;
using System.Linq;

class Program
{
    static void Main()
    {
        string text = @"..."; // 输入文本

        // 将字符串转换为字符数组
        char[] charArray = text.ToCharArray();

        // 使用LINQ查询统计每个字符的出现次数
        var charFrequency = charArray
            .GroupBy(c => c)
            .Select(g => new { Character = g.Key, Count = g.Count() })
            .OrderByDescending(g => g.Count)
            .ThenBy(g => g.Character);

        // 输出统计结果
        Console.WriteLine("字符频率统计:");
        foreach (var item in charFrequency)
        {
            Console.WriteLine($"字符 '{item.Character}' 出现了 {item.Count} 次");
        }
    }
}
```

### 代码解释
1. **字符数组转换**：`ToCharArray()`方法将字符串转换为字符数组，便于逐个处理字符。
2. **分组与统计**：`GroupBy(c => c)`按字符分组，`Select(g => new { ... })`创建包含字符及其出现次数的匿名对象。
3. **排序**：`OrderByDescending(g => g.Count)`按出现次数降序排序，`ThenBy(g => g.Character)`在次数相同时按字符升序排序。
4. **结果输出**：遍历统计结果，使用`Console.WriteLine`输出每个字符及其出现次数。

### 注意事项
- **性能**：对于非常大的文本，此方法可能效率较低，建议使用更优化的算法（如字典统计）。
- **字符范围**：若需处理Unicode字符或特殊符号，需确保编码支持。
- **过滤控制字符**：可根据需要过滤掉空格、换行符等非可见字符。

