## 题目

给定一个整数数组 nums 和一个目标值 target，请你在该数组中找出和为目标值的那 两个 整数，并返回他们的数组下标。

你可以假设每种输入只会对应一个答案。但是，数组中同一个元素不能使用两遍。

示例:

给定 nums = [2, 7, 11, 15], target = 9

因为 nums[0] + nums[1] = 2 + 7 = 9
所以返回 [0, 1]

## 题解

### 哈希表

遍历数组，用哈希表保存每个元素的值和索引，每次遍历的时候检查哈希表中是否存在 `target - nums[i]`，存在的话就返回结果

```JavaScript
/**
 * @param {number[]} nums
 * @param {number} target
 * @return {number[]}
 */
var twoSum = function(nums, target) {
    let m = new Map();
    for(let i=0;i<nums.length;++i){
        let t = target - nums[i];
        if(m.has(t)){
            return [m.get(t),i];
        }else{
            m.set(nums[i],i);
        }
    }
    return [];
};
```

时间复杂度：O(n)

空间复杂度：O(n)
# 1. 两数之和

## 题目

给定一个整数数组 nums 和一个目标值 target，请你在该数组中找出和为目标值的那 两个 整数，并返回他们的数组下标。

你可以假设每种输入只会对应一个答案。但是，数组中同一个元素不能使用两遍。

示例:

给定 nums = [2, 7, 11, 15], target = 9

因为 nums[0] + nums[1] = 2 + 7 = 9
所以返回 [0, 1]

## 解题思路

### 暴力法

遍历每个元素 x，并查找是否存在一个值与 target - x 相等的目标元素。

时间复杂度：O(n^2)
空间复杂度：O(1)

### 两遍哈希表

在第一次迭代中，将每个元素的值和它的索引添加到表中。然后，在第二次迭代中，检查每个元素所对应的目标元素（target - nums[i]）是否存在于表中。注意，该目标元素不能是 nums[i] 本身！

时间复杂度：O(n)
空间复杂度：O(n)

### 一遍哈希表

在进行迭代并将元素插入到表中的同时，检查表中是否已经存在当前元素所对应的目标元素。如果它存在，那我们已经找到了对应解，并立即将其返回。

时间复杂度：O(n)
空间复杂度：O(n)

## 测试用例

[2,7,11,15] 9 => [0,1]

## 实现

一遍哈希表：

```go
func twoSum(nums []int, target int) []int {
    m := make(map[int]int)
    for i, num := range nums {
        if j, ok := m[target - num]; ok {
            return []int{j, i}
        }
        m[num] = i
    }
    return nil
}
