**图像修复**是图像处理中恢复图像缺失部分的一种方法。这基本上就像照片恢复或消除不需要的对象。图像修复的工作原理是用相邻像素替换损坏的像素，使其看起来像是图像的一部分。这种算法在图像中物体被移除的区域(如小孔、斑点)有广泛的应用。在这种情况下，您需要填充的像素被算法识别，并用相邻的像素替换，直到被替换的像素到达目标像素。这就像用邻近的像素一点一点地替换坏像素，这样替换就不会被注意到。

在本文中，我们将实现这个算法，并用 OpenCV 库提供的函数来填充图像中的一些空间。OpenCV 库中有两种修复算法:

1.  **cv2。INPAINT_TELEA**
2.  **cv2。INPAINT_NS**

**语法:**cv2 . inpaint(src、inpaintMask、inpaintRadius、flags)

**参数:**

*   **src:** 输入图像
*   **inpaintMask:** 二进制掩码，指示要修复的像素。非零像素被认为是需要修复的区域。
*   **inpaintRadius:** 像素周围的邻域半径，考虑修复该像素。较大的值会使算法看起来更模糊。
*   **标志:**修复算法，应为 cv2。INPAINT_TELEA 或
